import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

// import { PartScrol1 } from "../assets/images/PartScrol1.png";

const Carousel = () => {
    const settings = {
      infinite: true,
      speed: 500,
      slidesToShow: 3, // Кількість видимих елементів одночасно
      slidesToScroll: 1, // Кількість елементів, що прокручуються за раз
      autoplay: true, // Автоматична прокрутка
      autoplaySpeed: 2000, // Швидкість автоматичної прокрутки (2 секунди)
    };

// export const Partners = () => {
    return (
        <div>
            <Slider settings={settings}>
                <div>Елемент 1</div>
                <div>Елемент 2</div>
                <div>Елемент 3</div>
                <div>Елемент 4</div>
                <div>Елемент 5</div>
            </Slider>
            <h1>PARTNERS</h1>
            <div>
                Item 1
            </div>
            <div>
                Item 2
            </div>
            <div>
                Item 3
            </div>
            <div>
                Item 4
            </div>
            <div>
                Item 5
            </div>
            <div>
                {/* <img src={PartScrol1} alt="Моє зображення" /> */}

                {/* <img src={require("../assets/images/PartScrol1.png").default} alt="Моє зображення" /> */}
            </div>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Sint enim iste tenetur nam dolorem, accusamus ratione numquam facilis sequi minima fuga possimus eius sit earum, nihil magni? Voluptate, perspiciatis soluta.</p>
        </div>
    )       
}

export default Carousel;
